  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Chincoteague
  National Wildlife Refuge outlines Refuge accomplishments from January through April
  of 1963. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
  raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and prescribed burning. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, and safety. Items of interest, N-R forms, and photographs
  are included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
